import React from 'react';
import Footer from '../../componentes/Footer.jsx';
import Header from '../../componentes/Header.jsx';
import '../../hojas-de-estilo/Confirmacion.css';
import { useState } from 'react';

function Confirmacion() {
    const [confirmaciondom, setConfirmaciondom] = useState ("Ingrese el domicilio...");
    const [confirmaciontel, setConfirmaciontel] = useState ("Ingrese número de celular...");
    return (
        <div className='Confirmacion-total'>
            <Header/>
            <p className='Confirmacion-texto'>Como querés recibir tu compra?</p>
            <p className='Confirmacion-domicilio'>Domicilio</p>
            <div className='Confirmacion-dom'>
                <input type ="text" className="Confirmacion-domdat" value = {confirmaciondom} />
            </div>
            <p className='Confirmacion-compra'>Recibir compra</p>
            <div className='Confirmacion-fecha'></div>
            <p className='Confirmacion-telefono'>Teléfono</p>
            <div className='Confirmacion-tel'>
                <input type ="text" className="Confirmacion-domdat" value = {confirmaciontel} />
            </div>
            <p className='Confirmacion-cantidad'>Cantidad</p>
            <div className='Confirmacion-lateral'>
                <img className="Imagen-libro"
                            src={require("../../imagenes/libro-alice.png")}
                            alt="Tarjeta de Libro Alice"/>
                <p className='Confirmacion-libro'>Libro:</p>
                <p className='Confirmacion-autor'>Autor:</p>
                <p className='Confirmacion-coleccion'>Coleccion:</p>
            </div>
            <Footer/>
        </div>
    );
  }

export default Confirmacion
